import React, { useState } from "react"

const APP=()=>{

 const [ inputList, setInputList]=useState(" buy apple");

 const itemEvent =(event)=>{
    setInputList(event.target.value);

 };

    return(
        <div className="navi">
            <div className="center">
                <br></br>
                <h1>ToDO List</h1>
                <br></br>
                <input type="text" placeholder="" onChange={itemEvent}/>
                <button>ADD</button>

                <ol>
                    <li>{inputList}</li>
                </ol>

            </div>

        </div>
    )

}
export default APP;
